import React from "react";
import { Table } from "react-bootstrap";

import "./Account.css";

const Account = () => {
  const [email, setEmail] = useState("johndoe@email.com");  
  return (
    <div>
      <Table striped bordered hover variant="dark">
        <thead>
          <tr>
            <th>Profile</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Email:</td>
            <td>{email}</td>
          </tr>
       </tbody>
      </Table> 
    </div>
  );
};

export default Account;
